import logo from './mosaic_logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
          <h1>Mosaic Mind Psychotherapy
          <h3>LCSW PC</h3>
          </h1>
      </header>
      <body>
        <p>Welcome to Mosaic Mind Psychotherapy</p>
      </body>
    </div>
  );
}

export default App;
